import { Link, page } from "react-router-dom";

import "./style.css";

const Home = () => {
  return (
    <div className="home">
      <div className="title">
        <h1>
          <p>Hi,</p>
          <p>I am Amna</p>
          <p>I am a Software development Student</p>
        </h1>
        <Link to="about">
          <button>About</button>
        </Link>
      </div>
      <div className="person">
        <img
          src={`${process.env.PUBLIC_URL}/my-logo.png`}
          alt="person picture"
        />
      </div>
    </div>
  );
};










